<!DOCTYPE html>
<html lang="en" xmlns="http://www.w3.org/1999/html">
  <head>
    <meta http-equiv="content-type" content="text/html; charset=utf-8" />
    <style>
      #LU__extension_wrapper {
        position: fixed;
        z-index: 2147483647;
        top: 16px;
        bottom: auto;
      }
      .LU__iframe-container {
        min-width: 320px;
        background-color: #fff;
        height: 90vh;
        width: 320px;
        top: 16px;
      }

      .LU__iframe-container.iframe-fullscreen {
        top: 0;
        height: 100vh;
        border-radius: unset !important;
        right: 0;
        box-sizing: content-box;
      }

      .LU__iframe-container.iframe-gmail {
        min-width: 300px;
        max-width: 300px;
        box-shadow: unset !important;
      }

      .LU__iframe-container.iframe-calendar {
          min-width: 300px;
          max-width: 300px;
      }

      .LU__loading_gif {
        text-align: center;
          height: 100%;
      }
      #lusha-loading-svg-gif {
        height: 62px;
        width: 180px;
      }

      #LU__extension_iframe {
        border-radius: 19px;
        border: 1px solid #e6e6e6;
        z-index: 999;
        box-shadow: 0 16px 30px rgba(12, 15, 28, 0.12);
      }

      #LU__extension_iframe.iframe-calendar {
          border: none;
      }

      #LU__extension_loader {
        z-index: 10;
        position: absolute;
        width: 320px;
        height: 90%;
        background-color: white;
        border-radius: 19px;
        display: flex;
        flex-direction: column;
        align-items: center;
        justify-content: center;
      }

      div.LU__at_container {
        align-items: center;
        justify-content: center;
        height: 100%;
      }

      /* Badge pieces ids */
      #LU__extension_badge_wrapper {
        display: none;
        z-index: 2147483640;
        position: fixed;
        transform: translateX(130%);
      }
      #LU__extension_badge_main {
        z-index: 2147483640;
        position: relative;
        transition: background-color 200ms linear;
        background-color: #0655FF;
        height: 84px;
        width: 32px;
      }
      #LU__extension_badge_wrapper #LU__extension_badge_main {
        cursor: pointer !important;
      }
      #LU__extension_badge_main:hover {
        background-color: #0948D1;
        transition: background-color 200ms linear;
      }
      #LU__extension_badge_main:hover #LU__extension_badge_divider {
        background-color: #0B42B9;
        transition: background-color 200ms linear;
      }
      #LU__extension_badge_main:hover .LU__badge_button {
        opacity: 1;
        transition: opacity 200ms linear;
      }
      #LU__extension_badge_main:active {
        background-color: #0B42B9;
      }
      #LU__extension_badge_main:active #LU__extension_badge_divider {
        background-color: #0948D1;
      }
      #LU__extension_badge_main:active .LU__badge_button {
        opacity: 1;
        background-color: #CDDDFF;
      }
      #LU__extension_badge_main:active .LU__badge_button path {
        fill: #0655FF;
      }

      #LU__extension_results {
        position: absolute;
        width: 16px;
        height: 16px;
        top: -8px;
        background-color: #FF4D6B;
        border-radius: 100%;
        line-height: 16px;
        text-align: center;
        font-size: 12px;
        color: #ffffff;
        z-index: 1000;
        display: none;
        font-weight: 400;
        font-family: CircularXXWeb, sans-serif;
        animation: fade-in 400ms;
      }
      #LU__extension_badge_logo {
        position: absolute;
        top: 6px;
        right: 6px;
        width: 20px;
        height: 20px;
        pointer-events: none;
      }
      #LU__extension_badge_divider {
        position: absolute;
        width: 32px;
        height: 1.5px;
        background-color: #0948D1;
        top: 32px;
        transition: border 200ms linear;
      }
      #LU__extension_badge_title {
        position: absolute;
        top: 40px;
        right: 11px;
        width: initial;
        height: initial;
        pointer-events: none;
      }

      #LU__extension_badge_wrapper #LU__loading {
        display: none;
        position: absolute;
        border-radius: 50%;
        width: 16px;
        height: 16px;
        top: 8px;
        right: 8px;
        border-top: 2px solid #0655FF;
        border-right: 2px solid #0655FF;
        border-bottom: 2px solid #0655FF;
        border-left: 2px solid #FFFFFF;
        transform: translateZ(0);
        animation: load8 1s infinite linear;
      }

      .LU__badge_button {
        position: absolute;
        display: flex;
        justify-content: center;
        align-items: center;
        opacity: 0;
        transition: opacity 200ms linear;
        width: 20px;
        height: 20px;
        background-color: #F6F6F6;
        border: 1px solid #ECECEC;
        border-radius: 2px;
        box-sizing: border-box;
        right: 6px;
      }

      .LU__badge_button:hover {
        background-color: #E6EEFF;
        border: 1px solid #CDDDFF;
      }
      .LU__badge_button:hover path {
        fill: #0655FF;
      }
      .LU__badge_button:active {
        background-color: #CDDDFF;
      }

      #LU__drag_button {
        bottom: -24px;
      }

      #LU__drag_button:hover {
        cursor: grab;
      }

      #LU__hide_badge_button {
        display: none;
        bottom: -48px;
      }

      #LU__hide_badge_button:hover {
        cursor: pointer;
      }

      #LU__extension_bulk_page {
        position: relative;
        display: flex;
        height: 40px;
        align-items: center;
        padding: 0 16px;
        cursor: pointer;
        background-color: #FFF;
        border: 1px solid #0655FF;
        border-radius: 4px;
        opacity: 1;
        transition: right 0.3s cubic-bezier(0.175, 0.2, 0.320, 1.275), left 0.3s cubic-bezier(0.175, 0.2, 0.320, 1.275), background-color 200ms linear;
      }

      #LU__extension_bulk_page:hover {
        background-color: #E6EEFF;
        transition: background-color 200ms linear;
      }

      #LU__extension_bulk_page:active {
        background-color: #CDDDFF;
        transition: background-color 200ms linear;
      }

      #LU__extension_bulk_popup_msg {
        font-family: CircularXXWeb, sans-serif;
        font-size: 14px;
        line-height: 16px;
        font-weight: 500;
        color: #0655FF;
      }

      .draggable-cursor * {
        cursor: move !important; /* fallback: no `url()` support or images disabled */
        cursor: -webkit-grabbing !important; /* Chrome 1-21, Safari 4+ */
        cursor:    -moz-grabbing !important; /* Firefox 1.5-26 */
        cursor:         grabbing !important; /* W3C standards syntax, should come least */
      }

      /* Badge animation classes */
      .LU__fadein_animation {
        animation: fade-in 400ms;
      }
      .LU__slide_in_right {
        --slide-start: 130%;
        animation: slide-in 500ms forwards;
      }
      .LU__slide_out_right {
        --slide-end: 130%;
        animation: slide-out 500ms forwards;
      }
      .LU__slide_in_left {
        --slide-start: -130%;
        animation: slide-in 500ms forwards;
      }
      .LU__slide_out_left {
        --slide-end: -130%;
        animation: slide-out 500ms forwards;
      }
      .LU__peek_in_right {
        --slide-start: 77%;
        animation: slide-in 500ms forwards;
      }
      .LU__peek_out_right {
        --slide-end: 77%;
        animation: slide-out 500ms forwards;
      }
      .LU__peek_in_left {
        --slide-start: -77%;
        animation: slide-in 500ms forwards;
      }
      .LU__peek_out_left {
        --slide-end: -77%;
        animation: slide-out 500ms forwards;
      }

      /* disable overwriting by some websites */
      #LU__extension_badge_wrapper svg {
        stroke: none;
      }

      #LU__extension_badge_wrapper svg {
        display: block !important;
      }

      #LU__extension_badge_wrapper .LU__svg_hide {
        display: none !important;
      }

      #LU_extension_calendar_badge_wrapper .lusha-badge-selected{
          background: #0655FF;
      }

      @keyframes load8 {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(360deg);
        }
      }
      @keyframes fade-in {
        from { opacity: 0; }
        to { opacity: 1 }
      }
      @keyframes slide-in {
        from { transform: translateX(var(--slide-start)); }
        to { transform: translateX(var(--slide-end, 0%)); }
      }
      @keyframes slide-out {
        from { transform: translateX(var(--slide-start, 0%)); }
        to { transform: translateX(var(--slide-end)); }
      }
    </style>
